tables.table_schema:
CREATE TABLE LabeledImageData (
    id INT PRIMARY KEY,
    image_url VARCHAR(255),
    label VARCHAR(50),
    created_at TIMESTAMP
);

CREATE TABLE labeled_images (
    image_id UUID PRIMARY KEY,
    image_data BYTEA,
    label VARCHAR(50)
);
CREATE TABLE model_training_data (
    data_id UUID PRIMARY KEY,
    training_data BYTEA,
    label VARCHAR(50)
);

CREATE TABLE labeled_data (
    id INT PRIMARY KEY,
    image_url TEXT,
    label TEXT
);

CREATE TABLE image_labels (
    id INT PRIMARY KEY,
    image_id INT REFERENCES labeled_data(id),
    label TEXT
);

CREATE TABLE model_training (
    id INT PRIMARY KEY,
    model_id INT REFERENCES image_labels(id),
    accuracy FLOAT
);

CREATE TABLE image_labels (
    image_id SERIAL PRIMARY KEY,
    label_id SERIAL PRIMARY KEY
);

CREATE TABLE images (
    image_id SERIAL PRIMARY KEY,
    image_data BYTEA
);

CREATE TABLE labels (
    label_id SERIAL PRIMARY KEY,
    label_name VARCHAR(50)
);

CREATE TABLE ImageLabels (
    id INT PRIMARY KEY,
    image_id INT,
    label VARCHAR(255)
);

CREATE TABLE Images (
    id INT PRIMARY KEY,
    image_url VARCHAR(255),
    upload_date DATE
);

CREATE TABLE ImageTags (
    id INT PRIMARY KEY,
    image_id INT,
    tag VARCHAR(50)
);

CREATE TABLE TrainingData (
    id INT PRIMARY KEY,
    image_id INT,
    label_id INT
);

CREATE TABLE Models (
    id INT PRIMARY KEY,
    model_name VARCHAR(50),
    accuracy FLOAT
);
